Infested: Series 2

Health-Medical Documentary hosted by Eric Meyers, published by Discovery Channel in 2012 - English narration


Information
------------------------------

Infested: Series 2
Infested unearths real-life horror stories of homes crawling with cockroaches, over-run with rats, invaded by bedbugs, and plagued by vermin hazardous to your physical and mental health. Determined to claim family homes as their own, these invaders use overwhelming numbers, sustained attacks and the threat of disease to conquer houses and apartments. Homes become battlegrounds, leaving their human victims with no place to hide. First-hand accounts and dramatic recreations reveal the pain and anguish of each family s fight to reclaim their homes as their own, but no matter what the outcome, home will never feel the same again.




2)  Dirty Wars 
An older couple and their children have been living happily in their large home in eastern Pennsylvania, when suddenly; they discover German cockroaches spreading from a neighbour's house to their own house. In California, a single mother, her daughter, and their dog move to start all over in an apartment, when suddenly, they sense an unpleasant odor. Objects start disappearing, and bits of cotton suddenly appear in places. A rat is soon discovered, and lots more spread in the house. In Kentucky, a married couple and their two children move into a new house. As soon as she steps in, though, the mother has been uneasy, with the bad smell and the strange noises. When the father discovers a bat, they forget about it. However, the family soon learns that they are sharing their home with many little brown bats.


